export const Header = () => {
    return (
        <ChakraProvider>
            <Box minHeight='100vh' backgroundColor='black'>        
            <Box color='black'  fontSize='50px' borderRadius='20px'>

            <Skeleton startColor='purple.500' endColor='black.500' height='20px' fadeDuration={4}/>  
                <h1>Dio Bank</h1>   
                
                
            </Box>
            </Box>
        </ChakraProvider>

    )
}
